import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  const linkStyle = ({ isActive }) => ({
    display: 'block',
    padding: '8px 0',
    fontWeight: isActive ? 'bold' : 'normal',
    color: isActive ? '#007bff' : '#000',
    textDecoration: 'none',
  });

  return (
    <div style={{
      width: '250px',
      background: '#f0f0f0',
      height: '100vh',
      padding: '20px',
      boxShadow: '2px 0 5px rgba(0,0,0,0.1)'
    }}>
      <h3>Navigation</h3>
      <nav>
        <NavLink to="/transfer-certificate" style={linkStyle}>Transfer Certificate</NavLink>
        <NavLink to="/paragraph1" style={linkStyle}>Paragraph 1</NavLink>
        <NavLink to="/paragraph2" style={linkStyle}>Paragraph 2</NavLink>
        <NavLink to="/paragraph3" style={linkStyle}>Paragraph 3</NavLink>
        <NavLink to="/paragraph4" style={linkStyle}>Paragraph 4</NavLink>
        <NavLink to="/paragraph5" style={linkStyle}>Paragraph 5</NavLink>
        <NavLink to="/paragraph6" style={linkStyle}>Paragraph 6</NavLink>
        <NavLink to="/paragraph7" style={linkStyle}>Paragraph 7</NavLink>
      </nav>
    </div>
  );
};

export default Sidebar;
